import axios from 'axios';
import Link from 'next/Link'

 function listwords({ words }) {


    return (
        <div>
        {words.tempDoc.map(function(item, i){

             return  <Link prefetch href={{pathname: '/definitions', query: {id: item.word}}} as={`/definitions/${item.word}`}><a>{item.word}</a></Link>
            })}
      </div>
      )
}

export async function getServerSideProps() {

   const wordlist = await axios.get(`http://localhost:5050/api/words`)

    return {
      props: {
       words: wordlist.data
      }
    }
  }


export default listwords
